import { createQueryListStore } from '../lib/query.2';

type EventModel = { eventID: string, eventName: string };

export const eventListStore = createQueryListStore<EventModel>('/app/event/popup/list', {
	successCallback: () => {
		eventListStore2.query().then();
	},
});

export const eventListStore2 = createQueryListStore<EventModel>('/app/event/popup/list');
